Information
------------------------------

Betty White Goes Wild
The 'Golden Girls' star explains why she loves big cats so much, attempting to safeguard their future and convince others to share her feelings.
Betty White might have been in show business for over 70 years now, but her love of animals, as she says, &quot;goes back to the womb.&quot; As spokeswoman for National Geographic's &quot;Cause an Uproar&quot; big cat initiative Miss White has already expressed her deep love of the planet's greatest felines. And now she's on a mission - she's not only going to tell you why she loves big cats so much, but she's also going to get you to love them just as much as she does. In Betty White Goes Wild! The Emmy Award winner takes you on a personal, intimate journey with extraordinary, unique access - to not one, not two, but three of America's top zoos and safari parks. Sharing her special VIP backstage pass Betty White takes the audience on an irreverent tour of everything big cat.

